import { SimpleGrid, Stack, Input, Textarea } from "@chakra-ui/react";
import React from "react";

const ContactForm = () => {
  return (
    <SimpleGrid
      direction="column"
      columns={1}
      spacing={8}
      bg="gray.main"
      p="8"
      borderRadius="15"
    >
      <Stack direction="row" spacing={3}>
        <Input variant="outline" placeholder="Name" />
        <Input variant="outline" placeholder="Last" />
      </Stack>
      <Stack spacing={8}>
        <Input variant="outline" placeholder="Email" />
        <Input variant="outline" placeholder="Phone" />
        <Textarea variant="outline" placeholder="Message" />
      </Stack>
    </SimpleGrid>
  );
};

export default ContactForm;
